import os
import json

def generate_annotation(image_list):
    annotation = {}
    for image in image_list:
        filename, _ = os.path.splitext(image)
        celeb_name_parts = filename.split("-")[0]
        celeb_name = " ".join([name.capitalize() for name in split_name(celeb_name_parts)])
        annotation[image] = {
            "celeb_boxes": [],
            "names": [celeb_name]
        }
    return annotation

def split_name(name):
    #split the name
    parts = []
    current_part = ""
    for char in name:
        if char.isupper() and current_part:
            parts.append(current_part)
            current_part = char
        else:
            current_part += char
    if current_part:
        parts.append(current_part)
    return parts


